import React from 'react';

class Orders extends React.Component {
  render() {
    return (
      <div>
        <h1>Current orders</h1>
        <div className="container">
          <a href="/Orders/new" className="btn btn-primary"></a>
        </div>
      </div>
    )
  }
}

export default Orders;
